import React from 'react'

const Socials = () => {
  return (
    <div className="home__social">
        <a href="https://www.instagram.com/shehabwaleedd/" className="home__social-icon" target='_blank'><i class="uil uil-instagram"></i></a>
        <a href="https://github.com/shehabwaleedd" className="home__social-icon" target='_blank'><i class="uil uil-github-alt"></i></a>
        <a href="https://www.linkedin.com/in/shehabwaleedd/" className="home__social-icon" target='_blank'><i class="uil uil-linkedin"></i></a>
    </div>
  )
}

export default Socials
